import * as React from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';
import TextField from '@mui/material/TextField';
import Typography from '@mui/material/Typography';
import Grid from '@mui/material/Grid';
import Tooltip from '@mui/material/Tooltip';
import { styled } from '@mui/material/styles';
import AppTheme from '../../components/shared-theme/AppTheme';
import MuiCard from '@mui/material/Card';
import Stack from '@mui/material/Stack';

const Card = styled(MuiCard)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignSelf: 'center',
  width: '100%',
  padding: theme.spacing(4),
  gap: theme.spacing(2),
  margin: 'auto',
  boxShadow:
    'hsla(220, 30%, 5%, 0.05) 0px 5px 15px 0px, hsla(220, 25%, 10%, 0.05) 0px 15px 35px -5px',
  [theme.breakpoints.up('sm')]: {
    width: '450px',
  },
}));

const SignUpContainer = styled(Stack)(({ theme }) => ({
  height: "105vh",
  minHeight: "100%",
  padding: theme.spacing(2),
  position: "relative",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
}));

export default function SignUp(props) {
  const [formData, setFormData] = React.useState({
    firstName: '',
    lastName: '',
    email: '',
    phone: '',
    cin: '',
    address: '',
    speciality: '',
    dateOfBirth: '',
    password: ''
  });

  const [errors, setErrors] = React.useState({});

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData(prev => ({ ...prev, [name]: value }));
    if (errors[name]) {
      setErrors(prev => ({ ...prev, [name]: '' }));
    }
  };

  const handleSubmit = (event) => {
    event.preventDefault();
  };

  return (
    <AppTheme {...props}>
      <CssBaseline enableColorScheme />
      <SignUpContainer direction="column">
        <Card variant="outlined">
          <Typography component="h1" variant="h4">S'inscrire</Typography>
          <Box component="form" onSubmit={handleSubmit}>
            <Grid container spacing={2}>
              <Grid item xs={12} sm={6}>
                <FormControl fullWidth>
                  <FormLabel>Prénom</FormLabel>
                  <Tooltip title={errors.firstName || ""} open={!!errors.firstName} arrow>
                    <TextField 
                      required 
                      name="firstName" 
                      value={formData.firstName} 
                      onChange={handleChange} 
                      error={!!errors.firstName} 
                      sx={{ '& .MuiOutlinedInput-root fieldset': { borderColor: errors.firstName ? 'red' : '' } }}
                    />
                  </Tooltip>
                </FormControl>
              </Grid>
              <Grid item xs={12} sm={6}>
                <FormControl fullWidth>
                  <FormLabel>Nom</FormLabel>
                  <Tooltip title={errors.lastName || ""} open={!!errors.lastName} arrow>
                    <TextField 
                      required 
                      name="lastName" 
                      value={formData.lastName} 
                      onChange={handleChange} 
                      error={!!errors.lastName} 
                      sx={{ '& .MuiOutlinedInput-root fieldset': { borderColor: errors.lastName ? 'red' : '' } }}
                    />
                  </Tooltip>
                </FormControl>
              </Grid>
              <Grid item xs={12}>
                <FormControl fullWidth>
                  <FormLabel>Email</FormLabel>
                  <Tooltip title={errors.email || ""} open={!!errors.email} arrow>
                    <TextField 
                      required 
                      name="email" 
                      type="email" 
                      value={formData.email} 
                      onChange={handleChange} 
                      error={!!errors.email} 
                      sx={{ '& .MuiOutlinedInput-root fieldset': { borderColor: errors.email ? 'red' : '' } }}
                    />
                  </Tooltip>
                </FormControl>
              </Grid>
              <Grid item xs={12}>
                <FormControl fullWidth>
                  <FormLabel>Mot de passe</FormLabel>
                  <Tooltip title={errors.password || ""} open={!!errors.password} arrow>
                    <TextField 
                      required 
                      name="password" 
                      type="password" 
                      value={formData.password} 
                      onChange={handleChange} 
                      error={!!errors.password} 
                      sx={{ '& .MuiOutlinedInput-root fieldset': { borderColor: errors.password ? 'red' : '' } }}
                    />
                  </Tooltip>
                </FormControl>
              </Grid>
            </Grid>
            <Button type="submit" fullWidth variant="contained">S'inscrire</Button>
          </Box>
        </Card>
      </SignUpContainer>
    </AppTheme>
  );
}
